import NavigationItem from "./NavigationItem";

const Navigation = () => {
  return (
    <ul className="links">
      <NavigationItem name="ABOUT US" />
      <NavigationItem name="INVENTORY" />
      <NavigationItem name="CONTACT US" />
      <li>
        <a href="" className="btn-apply-dark">
          APPLY NOW
        </a>
      </li>
    </ul>
  );
};

export default Navigation;
